import React, { useState } from "react";
import useSignUpForm from '../components/CustomHooks';



function Add() {

    const [state, setState] = useState([{
        id: 1,
        name: "Lawrence",
        powerlevel: 9000,
        age: 24
      },
    {
        id: 2,
        name: "Pam",
        powerlevel: 9000,
        age: 24
      }]); 

return(
  <form>
  <label>Name</label>
  <input type="text"/>
  <label> Power Level</label>
  <input type="text"/>
  <label> Age</label>
  <input type="text"/>
  <button type="text">Add</button>
</form>
  );
}
 
export default Add;
